// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract ForAndWhileLoops {
    function loops() external pure {
        for (uint256 i = 0; i < 10; i++) {
            if (i == 3) {
                continue;
            }
            if (i == 5) {
                break;
            }
        }

        uint256 j = 0;
        while (j < 10) {
            j++;
        }
    }

    function sum(uint256 n) external pure returns (uint256) {
        uint256 s;
        for (uint256 i = 1; i < n; i++) {
            s += i;
        }
        return s;
    }
}

